def customJsonGet(jsonString, path):
    data = json.loads(jsonString)
    keys = path.split('')[1:]
    for key in keys:
        if key.startswith('['):
            index = int(key.strip('[]'))
            data = data[index]
        else:
            data = data.get(key.strip('"'))
    return data

